import React from 'react';
import './Player.css';

function Player() {
  return (
    <div className="player">

      <a href="javascript:void();">
        <i class="fas fa-chevron-left"></i>
      </a>
      <a href="javascript:void();">
        <i class="fa fa-play" aria-hidden="true"></i>
      </a>
      <a href="javascript:void();">
        <i class="fas fa-chevron-right"></i>
      </a>
    </div>
  );
}

export default Player;
